import React, { Component } from "react";
class QuestionLayout extends Component {
  state = {};
  render() {
    return (
      <div className="container p-5">
        <div className="row">
          <div col-md-6>Question</div>
          <div>Answer</div>
        </div>
      </div>
    );
  }
}

export default QuestionLayout;
